    document.querySelector(".postpozitsiyaoyna").style =
      "position: absolute;display:none;";
  }

  function putpozitsiyaoyna(id) {
    document.querySelector(".putpozitsiyaoyna").style =
      "position: absolute;display:block;";
    setkey4(id);
